import axios from 'axios'

const axiosInstance = axios.create({
    baseURL: `http://localhost:3000`
});

axiosInstance.interceptors.response.use(
    (response) => response,
    (error) =>
    Promise.reject(
        (error.response && error.response.data) || 'uh oh'
    )
)

export default axiosInstance
